      SELECT DISTINCT - ( cor0.col0 ) FROM tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9732.out
    data: |
      -7
      -78
      -79
